 def is_prime(n):
    if n < 2: return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0: return False
    return True

def find_number():
    lower = 20
    upper = 40
    while True:
        num = (lower+upper)//2
        square = int(num**0.5) + 1
        if is_prime(square*square): return square*square - 1
        elif num == lower: raise ValueError("No solution found")
        else: upper = num

try:
    print(find_number())
except ValueError as e:
    print(e)
